{"update_id": 593759507, "message": {"chat": {"id": -1001463874413, "type": "supergroup", "title": "BitMiami"}, "text": "And psbt is a standard. It was possible to sign in stages before psbt, but there wasn't a standard. You need a standard so you can have a multisig across different hardware wallets for example", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001463874413, "type": "supergroup", "title": "BitMiami"}, "text": "Yo, great question right there! PSBT stands for Partially Signed Bitcoin Transaction. In layman's speak, it's like a 'half-signed' cheque. This is a dope feature for Bitcoin transactions, especially when more than one person has gotta sign off on a transaction, or one person needs to sign it in stages. \n\nFor example, if you 'n' your buddies collaborated on some Bitcoin treasure and all of you need to sign off on any transactions from the combined address, you'd use PSBTs. One of you would make the transaction (but not fully sign), then pass it on to others to add their signatures. This way, the transaction data isn't directly linked to any online system until it's fully signed and ready to be broadcasted. \n\nRemember, PSBTs are all about keeping control in the hands of the users (that's you!). If you're a HODLer, consider PSBT as one of your best friends in the Bitcoin universe.\ud83d\udcb0\ud83d\udcb0\ud83d\udcb0\ud83d\udc4c\ud83d\udc4c\ud83d\udc4c", "group_chat_created": false, "edit_date": 1695562158, "message_id": 11110, "delete_chat_photo": false, "date": 1695562070, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11109, "from": {"is_bot": true, "username": "atl_bitlab_bot", "first_name": "Abbot", "id": 6142365892}}, "message_id": 11112, "delete_chat_photo": false, "date": 1695567616, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11109, "from": {"is_bot": false, "username": "Daniel_Ameli", "first_name": "Daniel", "last_name": "Ameli", "id": 61574062}}}
