{"update_id": 593759565, "message": {"chat": {"id": -1001463874413, "type": "supergroup", "title": "BitMiami"}, "text": "I would have to read more on it but based on what the bot, It would be cool to have a regulatory framework for Bitcoin.\n\nAnd $600 is about the limit for paying contractors without having to issue them a 1099 or whatever.\n\nI'm okay with that because it treats it just like any other transaction.\n\nI don't like the part where it talks about limiting self-custody of Bitcoin though.\n\nThat's madness.\n\nIf I'm crazy enough to bury all my money in my backyard then I damn well better be able to do it.\n\nThis is America still right?\n\nBut ultimately unless the bill takes away the taxes for buying things with Bitcoin then I think it's short-sided", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001463874413, "type": "supergroup", "title": "BitMiami"}, "text": "Does anyone here have any opinions on the FIT21 bill that they would like to share with us? Daniel and I will be going to DC to meet with some representatives on it and we would love to share your perspectives", "group_chat_created": false, "message_id": 11122, "delete_chat_photo": false, "date": 1695677440, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "Marumover", "first_name": "Maru", "last_name": "Sabando", "id": 490007931}}, "message_id": 11126, "delete_chat_photo": false, "date": 1695689952, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11122, "from": {"is_bot": false, "username": "ProofOfWorkFitness", "first_name": "Jae", "last_name": "BTC Personal Trainer", "id": 1639078333, "is_premium": true}}}
