{"update_id": 593759676, "message": {"chat": {"id": -1001463874413, "type": "supergroup", "title": "BitMiami"}, "text": "I can confirm 1 of the restaurants using us had $2000 CAD volume in about 2 months.\nAnother restaurant that just came on board about 3 weeks ago, has had $1000 CAD volume.\n \nThe businesses using us have some people paying with using their VISA. \n1 of the selling points I use when I'm trying to onboard merchants is that they will get increased overall sales because people come to support the business regardless of weather they pay in Bitcoin/Lightning or not.  Of course the majority of their increased volume of their new clientele is from Lightning.\nThis is all during a bear market. Imagine if it was a bull market.\n\nI can also confirm that the majority of the business owners that are using us (Coinos.io) are HODLING their BTC and funding their cash registers with cash to balance at the end of night(s).\n\nAll this being said, are great tools to onboarding new users in to Bitcoin. When people are aware you can spend it at places, it improves no-coiners' confidence.", "forward_date": 1695936851, "group_chat_created": false, "entities": [{"length": 68, "type": "bold", "offset": 555}, {"length": 79, "type": "bold", "offset": 623}, {"length": 79, "type": "underline", "offset": 623}, {"length": 9, "type": "url", "offset": 702}, {"length": 9, "type": "bold", "offset": 702}, {"length": 9, "type": "underline", "offset": 702}, {"length": 103, "type": "bold", "offset": 711}, {"length": 103, "type": "underline", "offset": 711}], "forward_from": {"is_bot": false, "username": "TheBitcoinAdvocate", "first_name": "Cole -", "last_name": "Certified Bitcoin Professional", "id": 1693761869}, "message_id": 11134, "delete_chat_photo": false, "date": 1695936967, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "TheBitcoinAdvocate", "first_name": "Cole -", "last_name": "Certified Bitcoin Professional", "id": 1693761869}}}
{"update_id": 593759677, "message": {"chat": {"id": -1001463874413, "type": "supergroup", "title": "BitMiami"}, "text": "How did you type this so fast? lol", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001463874413, "type": "supergroup", "title": "BitMiami"}, "text": "Dude, those are some super chill stats you got there! The fact that restaurateurs are starting to hodl their BTC and balance their cash tills at the end of the night is all sorts of epic. You know, this whole shift we're seeing is a testament to Bitcoin's value not just as a store of value, but as an actual currency. \n\nOh, and props on the wealth that these establishments have gained from the Lightning Network! It's all proof that - bear market or bull market - people find real value in the ability to transact in Bitcoin, especially when it comes with the convenience that Lightning brings!\n\nJust goes to show that Bitcoin isn't just about sitting on a pile of virtual gold. It's about enabling a whole new way of doing business. It's a brave new world out there, y'all. Stay humble, stay hungry, and keep on stacking those sats! \ud83c\udf7b\ud83d\udcb0\u26a1", "group_chat_created": false, "message_id": 11135, "delete_chat_photo": false, "date": 1695936985, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11134, "from": {"is_bot": true, "username": "atl_bitlab_bot", "first_name": "Abbot", "id": 6142365892}}, "message_id": 11136, "delete_chat_photo": false, "date": 1695937003, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11134, "from": {"is_bot": false, "username": "TheBitcoinAdvocate", "first_name": "Cole -", "last_name": "Certified Bitcoin Professional", "id": 1693761869}}}
