{"update_id": 593759754, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Hey! Stephen and I would like to introduce Abbot (aka the ATL BitLab Bot). Many of you already encountered him either at the BitLab party or when he broke out of the Lab the other night to hang out with you in this channel.\n\nAbbot was created to be a community helper bot. He can answer basic questions about bitcoin, help people find the meetup locations, and tell jokes. In the future, we plan for him to do even more!\n\nTo speak, the Abbot code copies messages from this channel to our server and then pipes them into OpenAI. In other words, when Abbot is activated, he stores data from this channel outside of telegram.\n\nIn our view, this isn\u2019t a big deal because this telegram channel is public and unencrypted. Abbot is just taking data that\u2019s already public and copying it elsewhere so we can make it more useful. Furthermore, we can have Abbot selectively exclude messages from people who want to opt-out.\n\nHowever, not everybody may share this opinion. Therefore, we wanted to have a public discussion about this. How do you feel about Abbot being in this channel?\n\nBitMiami is already using them in their channel. We would love to share this tool with our community, but we want to check community consensus on the matter first.\n\nShould Abbot be in this channel? \ud83d\udc4d or \ud83d\udc4e? You can DM Stephen or myself if you prefer to provide private feedback.", "group_chat_created": false, "message_id": 11128, "delete_chat_photo": false, "date": 1696033281, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
{"update_id": 593759755, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "group_chat_created": false, "pinned_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Hey! Stephen and I would like to introduce Abbot (aka the ATL BitLab Bot). Many of you already encountered him either at the BitLab party or when he broke out of the Lab the other night to hang out with you in this channel.\n\nAbbot was created to be a community helper bot. He can answer basic questions about bitcoin, help people find the meetup locations, and tell jokes. In the future, we plan for him to do even more!\n\nTo speak, the Abbot code copies messages from this channel to our server and then pipes them into OpenAI. In other words, when Abbot is activated, he stores data from this channel outside of telegram.\n\nIn our view, this isn\u2019t a big deal because this telegram channel is public and unencrypted. Abbot is just taking data that\u2019s already public and copying it elsewhere so we can make it more useful. Furthermore, we can have Abbot selectively exclude messages from people who want to opt-out.\n\nHowever, not everybody may share this opinion. Therefore, we wanted to have a public discussion about this. How do you feel about Abbot being in this channel?\n\nBitMiami is already using them in their channel. We would love to share this tool with our community, but we want to check community consensus on the matter first.\n\nShould Abbot be in this channel? \ud83d\udc4d or \ud83d\udc4e? You can DM Stephen or myself if you prefer to provide private feedback.", "group_chat_created": false, "message_id": 11128, "delete_chat_photo": false, "date": 1696033281, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}, "message_id": 11129, "delete_chat_photo": false, "date": 1696033287, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11128, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
{"update_id": 593759756, "edited_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Hey everyone! Stephen and I would like to introduce Abbot (aka the ATL BitLab Bot). Many of you already encountered him either at the BitLab party or when he broke out of the Lab the other night to hang out with you in this channel.\n\nAbbot was created to be a community helper bot. He can answer basic questions about bitcoin, help people find the meetup locations, and tell jokes. In the future, we plan for him to do even more!\n\nTo speak, the Abbot code copies messages from this channel to our server and then pipes them into OpenAI. In other words, when Abbot is activated, he stores data from this channel outside of telegram.\n\nIn our view, this isn\u2019t a big deal because this telegram channel is public and unencrypted. Abbot is just taking data that\u2019s already public and copying it elsewhere so we can make it more useful. Furthermore, we can have Abbot selectively exclude messages from people who want to opt-out.\n\nHowever, not everybody may share this opinion. Therefore, we wanted to have a public discussion about this. How do you feel about Abbot being in this channel?\n\nBitMiami is already using them in their channel. We would love to share this tool with our community, but we want to check community consensus on the matter first.\n\nShould Abbot be in this channel? \ud83d\udc4d or \ud83d\udc4e? You can DM Stephen or myself if you prefer to provide private feedback.", "group_chat_created": false, "edit_date": 1696033299, "message_id": 11128, "delete_chat_photo": false, "date": 1696033281, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
{"update_id": 593759757, "edited_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Hey everyone! Stephen and I would like to formally introduce Abbot (aka the ATL BitLab Bot). Many of you already encountered him either at the BitLab party or when he broke out of the Lab the other night to hang out with you in this channel.\n\nAbbot was created to be a community helper bot. He can answer basic questions about bitcoin, help people find the meetup locations, and tell jokes. In the future, we plan for him to do even more!\n\nTo speak, the Abbot code copies messages from this channel to our server and then pipes them into OpenAI. In other words, when Abbot is activated, he stores data from this channel outside of telegram.\n\nIn our view, this isn\u2019t a big deal because this telegram channel is public and unencrypted. Abbot is just taking data that\u2019s already public and copying it elsewhere so we can make it more useful. Furthermore, we can have Abbot selectively exclude messages from people who want to opt-out.\n\nHowever, not everybody may share this opinion. Therefore, we wanted to have a public discussion about this. How do you feel about Abbot being in this channel?\n\nBitMiami is already using them in their channel. We would love to share this tool with our community, but we want to check community consensus on the matter first.\n\nShould Abbot be in this channel? \ud83d\udc4d or \ud83d\udc4e? You can DM Stephen or myself if you prefer to provide private feedback.", "group_chat_created": false, "edit_date": 1696033308, "message_id": 11128, "delete_chat_photo": false, "date": 1696033281, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
