{"update_id": 593759765, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Right now, storing the messages is the hacky solution. I\u2019m working as fast as I can on building an embedding database that\u2019s turns the messages into decimals that GPT can understand. So instead of text being stored, it\u2019s all just a bunch of numbers. And the next step after that would be to potentially implement a symmetric encryption on the data going into and coming out of that embeddings database", "group_chat_created": false, "message_id": 11137, "delete_chat_photo": false, "date": 1696035993, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
{"update_id": 593759766, "edited_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Right now, storing the text of the messages is the hacky solution. I\u2019m working as fast as I can on building an embedding database that\u2019s turns the messages into decimals that GPT can understand. So instead of text being stored, it\u2019s all just a bunch of numbers. And the next step after that would be to potentially implement a symmetric encryption on the data going into and coming out of that embeddings database", "group_chat_created": false, "edit_date": 1696036008, "message_id": 11137, "delete_chat_photo": false, "date": 1696035993, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
{"update_id": 593759767, "edited_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Hey everyone! Stephen and I would like to formally introduce Abbot (aka ATL BitLab Bot). Many of you already encountered him either at the BitLab party or when he broke out of the Lab the other night to hang out with you in this channel.\n\nAbbot was created to be a community helper bot. He can answer basic questions about bitcoin, help people find the meetup locations, and tell jokes. In the future, we plan for him to do even more!\n\nTo speak, the Abbot code copies messages from this channel to our server and then pipes them into OpenAI. In other words, when Abbot is activated, he stores data from this channel outside of telegram.\n\nIn our view, this isn\u2019t a big deal because this telegram channel is public and unencrypted. Abbot is just taking data that\u2019s already public and copying it elsewhere so we can make it more useful. Furthermore, we can have Abbot selectively exclude messages from people who want to opt-out.\n\nHowever, not everybody may share this opinion. Therefore, we wanted to have a public discussion about this. How do you feel about Abbot being in this channel?\n\nBitMiami is already using them in their channel. We would love to share this tool with our community, but we want to check community consensus on the matter first.\n\nShould Abbot be in this channel? \ud83d\udc4d or \ud83d\udc4e? You can DM Stephen or myself if you prefer to provide private feedback.", "group_chat_created": false, "edit_date": 1696036067, "message_id": 11128, "delete_chat_photo": false, "date": 1696033281, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
{"update_id": 593759768, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Something else to note: the data being stored and sent to OpenAI doesn\u2019t label \u201cwho\u201d sent it. Just that it was sent to the group. Kind of like the true spirit of BitDevs: it knows what was said but not who said it.", "group_chat_created": false, "message_id": 11138, "delete_chat_photo": false, "date": 1696036181, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
