{"update_id": 593759824, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "@sbddesign, @HODLBarbarian, during Wednesday's BitPlebs I had asked about how the Extended Fingerprint (xfp) is derived from the Extended Public Key (xpub).  I found the answer on Bitcoin Stackexchange:\n\n\"The fingerprint of a public key is defined in BIP 32 as the first 4 bytes of the RIPEMD160 hash of the SHA256 hash of the public key. The fingerprint of a particular xpub can be gotten from that xpub\"\n\nFull answer:  https://bitcoin.stackexchange.com/questions/92534/what-is-an-extended-fingerprint-xfp-and-how-does-it-differ-from-an-xpub", "group_chat_created": false, "entities": [{"length": 10, "type": "mention", "offset": 0}, {"length": 14, "type": "mention", "offset": 12}, {"length": 203, "type": "italic", "offset": 204}, {"length": 121, "type": "url", "offset": 421}], "message_id": 11174, "delete_chat_photo": false, "date": 1696293999, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "jordan_bravo", "first_name": "Jordan", "last_name": "Bravo", "id": 34495958, "language_code": "en"}}}
