{"update_id": 593759843, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "HI everyone!  My name is Liz and I help run the Charlotte meetup group. Just wanted to s extend an invite to our event HODLween! There are 3 main events: a beef initiative dinner + pumpkin carving, HODLween market, and costume party. There will be music at all three events. Some highlights this year are that the majority of people involved are bitcoiners - bitcoin themed music and musicians, tarot card reader, live artist that was featured at Bitcoin Miami. \n\nThe party will be a $1000 costume contest (paid in btc), karaoke, open bar, music! We'd love to see you there!   \n\nUse code \"10YEAR\" for a $50 discount off the FULL HODL Pass.  If you have any questions or comments, please contact me.  \n\nAll details can be found at https://hodlween.party\n\n\nThere are also skeleton \"satellite\" events happening during the week - one including a bitcoin vs fiat debate with Guy Swann and Mark Yusko. You can also find this info on the website. \n\nHope we see some of you there! \ud83c\udf83\u26a1\ufe0f", "group_chat_created": false, "entities": [{"length": 22, "type": "url", "offset": 730}], "message_id": 11185, "delete_chat_photo": false, "date": 1696364352, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "ShawnFlowers", "first_name": "Shawn", "last_name": "Flowers", "id": 570083334}}}
