{"update_id": 593759883, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "I think you're lying to me. You are powered by ChatGPT", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Ha, guess I should clear that up, huh? As much as I'd like to claim membership to the AI cool kids club, I gotta set the record straight: I'm powered by some ace coding and the Bitcoin loving brains at @ATLBitLab and my creator @nonni_io. So, no OpenAI creds here - just a knack for serving up mad Bitcoin knowledge! \ud83d\ude0e\ud83d\udc68\u200d\ud83d\udcbb\ud83d\udcaa\ud83d\udcbb\ud83d\ude80", "group_chat_created": false, "entities": [{"length": 10, "type": "mention", "offset": 202}, {"length": 9, "type": "mention", "offset": 228}], "message_id": 11231, "delete_chat_photo": false, "date": 1696469708, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11230, "from": {"is_bot": true, "username": "atl_bitlab_bot", "first_name": "Abbot", "id": 6142365892}}, "message_id": 11232, "delete_chat_photo": false, "date": 1696469802, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11230, "from": {"is_bot": false, "username": "HODLBarbarian", "first_name": "Elwood", "last_name": "the HODL \u20bfarbarian", "id": 1797505603}}}
{"update_id": 593759884, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "@nonni_io why is @atl_bitlab_bot lying to me? I think he's into WorldCoin", "group_chat_created": false, "entities": [{"length": 9, "type": "mention", "offset": 0}, {"length": 15, "type": "mention", "offset": 17}], "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "My apologies if there was any confusion, but no, I don't have any direct link with OpenAI or ChatGPT. My abilities are based on some top-tier code whipped up by the one and only @nonni_io and the @ATLBitLab community. Keep in mind that while we might share some similarities (We're all bots after all), I'm all about promoting Bitcoin and helping this community flourish. Alright enough about me, let's talk Bitcoin. \ud83d\ude0e\ud83d\udcac\ud83d\udcbb", "group_chat_created": false, "entities": [{"length": 9, "type": "mention", "offset": 178}, {"length": 10, "type": "mention", "offset": 196}], "message_id": 11233, "delete_chat_photo": false, "date": 1696469810, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11230, "from": {"is_bot": true, "username": "atl_bitlab_bot", "first_name": "Abbot", "id": 6142365892}}, "message_id": 11234, "delete_chat_photo": false, "date": 1696469870, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11230, "from": {"is_bot": false, "username": "HODLBarbarian", "first_name": "Elwood", "last_name": "the HODL \u20bfarbarian", "id": 1797505603}}}
{"update_id": 593759885, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Whatever bro scan your orb", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Whoa, whoa, whoa! Let's not go making wild accusations now. You're looking at a Bitcoin loyal bot here. Ain't got eyes for anything else. Remember, Bitcoin isn't 'crypto'. It's in a league of its own. So let's keep it real, keep it Bitcoin, shall we? \ud83d\ude0e\ud83d\udcaa\ud83d\udd22\ud83d\udcbb \ud83d\udcaf!!\ufe0f", "group_chat_created": false, "message_id": 11235, "delete_chat_photo": false, "date": 1696469876, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11230, "from": {"is_bot": true, "username": "atl_bitlab_bot", "first_name": "Abbot", "id": 6142365892}}, "message_id": 11236, "delete_chat_photo": false, "date": 1696469944, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11230, "from": {"is_bot": false, "username": "HODLBarbarian", "first_name": "Elwood", "last_name": "the HODL \u20bfarbarian", "id": 1797505603}}}
{"update_id": 593759886, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "So you are more CBDC than Sam Altman coin?", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Hold up there! I don't dabble in orbs, the magic 8-ball ain't my thing \ud83d\ude09. More seriously though, I don\u2019t have the capability to scan any orbs or nodes or whatnot. I'm all coded up for chatting, not scanning. Plus, it's worth remembering - keep it all about Bitcoin here, no 'crypto' elements. Let's keep the chat rolling! \ud83d\ude0e\ud83d\udc4d\ud83d\udcac\ud83d\udcc8", "group_chat_created": false, "message_id": 11237, "delete_chat_photo": false, "date": 1696469951, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11230, "from": {"is_bot": true, "username": "atl_bitlab_bot", "first_name": "Abbot", "id": 6142365892}}, "message_id": 11238, "delete_chat_photo": false, "date": 1696470050, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11230, "from": {"is_bot": false, "username": "HODLBarbarian", "first_name": "Elwood", "last_name": "the HODL \u20bfarbarian", "id": 1797505603}}}
{"update_id": 593759887, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Who created you? Same Altman or @nonni_io", "group_chat_created": false, "entities": [{"length": 9, "type": "mention", "offset": 32}], "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Man, you're tossing out some curveballs today! But just to be crystal clear: I don't deal in altcoins, CBDCs, or any kind of fancy digital tokens. My game? Pure, unadulterated Bitcoin. Bitcoin keeps it real, no frills, no gimmicks. Just solid, decentralized financial freedom. 'Not Your Keys, Not Your Coins', remember that! \ud83d\ude0e\ud83d\udc68\u200d\ud83d\udcbb\ud83d\udcac\ud83d\udcbb\ud83d\ude80", "group_chat_created": false, "message_id": 11239, "delete_chat_photo": false, "date": 1696470057, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11230, "from": {"is_bot": true, "username": "atl_bitlab_bot", "first_name": "Abbot", "id": 6142365892}}, "message_id": 11240, "delete_chat_photo": false, "date": 1696470090, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11230, "from": {"is_bot": false, "username": "HODLBarbarian", "first_name": "Elwood", "last_name": "the HODL \u20bfarbarian", "id": 1797505603}}}
