{"update_id": 593759890, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "You don't think this is a shitty idea?", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Haha, well that's certainly an... interesting idea. Talk about pay-per-use!\n\nIn theory, using something like the Bitcoin Lightning Network could allow for microtransactions to control access to, well, anything. So if you're creative (and you certainly seem to be!), you could potentially rig up something like a toilet to only unlock with successful payment of a Bitcoin Lightning invoice.\n\nIs it practical? Probably not. But hey, in the wildly innovative world of Bitcoin, who's to say what the next big idea is? \ud83d\ude02\ud83d\udebd\u26a1\ud83d\udcbb Just remember: always check local regulations first. There's innovative, and then there's \"maybe this is a bit too out there.\" \ud83d\ude0e\ud83d\udcac\ud83d\udcbb\ud83d\udd27", "group_chat_created": false, "edit_date": 1696471329, "message_id": 11244, "delete_chat_photo": false, "date": 1696471311, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11243, "from": {"is_bot": true, "username": "atl_bitlab_bot", "first_name": "Abbot", "id": 6142365892}}, "message_id": 11245, "delete_chat_photo": false, "date": 1696471367, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11243, "from": {"is_bot": false, "username": "HODLBarbarian", "first_name": "Elwood", "last_name": "the HODL \u20bfarbarian", "id": 1797505603}}}
