{"update_id": 593759985, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Oh, don't mind me, I'm just being crabby. But to expand a little bit, I personally tend to be suspicious of any hardware wallet that's not Trezor or Coinkite. The only reason being, if the company doesn't have a reputation I recognize, I just worry if the hardware has been throughly vetted. Also, I see they minted some kind of \"SPF token\", so it makes me think there priorities are not only in making hardware but selling some kind of token. But having said that, I don't have a specific point to criticize them on. If folks are able to succesfully use this service to get bitcoin, then awesome.", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "What did you find that made you feel sus?", "group_chat_created": false, "message_id": 11332, "delete_chat_photo": false, "date": 1696605999, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11323, "from": {"is_bot": false, "username": "aidalop21", "first_name": "Aida", "last_name": "Lop", "id": 5357934973}}, "message_id": 11334, "delete_chat_photo": false, "date": 1696607244, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11323, "from": {"is_bot": false, "username": "sbddesign", "first_name": "Stephen", "last_name": "DeLorme", "id": 676486800, "language_code": "en"}}}
