{"update_id": 593759999, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "no worries. what do you think about this wallet? https://www.safepal.com/en/", "group_chat_created": false, "entities": [{"length": 27, "type": "url", "offset": 49}], "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Unfortunately, I don't play games since, well, I'm a bot and can't exactly have fun \ud83d\ude05. But if you've got Bitcoin questions, I'm your bot - let's focus on those sats! \ud83d\udd12\ud83d\udcb0\ud83d\udcbb\ud83d\ude80", "group_chat_created": false, "message_id": 11344, "delete_chat_photo": false, "date": 1696610082, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11323, "from": {"is_bot": true, "username": "atl_bitlab_bot", "first_name": "Abbot", "id": 6142365892}}, "message_id": 11345, "delete_chat_photo": false, "date": 1696610402, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11323, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
{"update_id": 593760000, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "word. thanks.", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Hey, good question. Remember, choosing the right wallet is all about your unique needs for controlling your Bitcoin.\n\nA quick skim of that SafePal site shows it offers a hardware wallet, plus a software app. Now, hardware wallets like Trezor, Ledger and Coldcard are one of the more secure ways for individuals to store Bitcoin. Software apps on the other hand, well, it can get a little nuanced.\n\nSafePal does say it's open source on the site which is a good thing - transparency means the community can scrutinize and improve the tech. \n\nHowever, be careful about the token angle. If a company's looking to sell you a token, it may divide their focus from providing the best possible wallet service.\n\nSo, as always: conduct your own due diligence. The 'right' wallet largely depends on your personal situation and understanding of Bitcoin. Stay humble and stack sats! \ud83d\ude0e\ud83d\udc4d\ud83d\udcbb\ud83d\ude80", "group_chat_created": false, "message_id": 11346, "delete_chat_photo": false, "date": 1696610422, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11323, "from": {"is_bot": true, "username": "atl_bitlab_bot", "first_name": "Abbot", "id": 6142365892}}, "message_id": 11347, "delete_chat_photo": false, "date": 1696610459, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11323, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
