{"update_id": 593760018, "message": {"chat": {"id": 676486800, "type": "private", "last_name": "DeLorme", "first_name": "Stephen", "username": "sbddesign"}, "text": "Pretend to be a bitcoin product manager. Reword this product ticket in the voice of the user: \nThe node homescreen needs a total balance widget, that shows how much bitcoin the node has on it, how much are in lightning channels, how much is on-chain, etc. If it is reflected in the Surge totla balance widget, it should be in this widget as well. The only difference between this and the Surge one is that this one require the macaroon to be decrypted in order to see the balance. There is also a section on the node homepage that tells me info like how many channels the node has that are active, pending, or inactive. Like the total balance widget, this requires the node macaroon to be decrypted. I can mouse over the application buttons and I have the option to directly go to this application or bring up a modal to manage it. I can quickly see the status of my node, and it makes sense, whether I have Surge activated or not.\nChatGPT", "group_chat_created": false, "message_id": 1637, "delete_chat_photo": false, "date": 1696623457, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "sbddesign", "first_name": "Stephen", "last_name": "DeLorme", "id": 676486800, "language_code": "en"}}}
