{"update_id": 593760146, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Hey everyone! The mobile app I've been working on for almost 2 years is FINALLY live!! We're looking for any/all feedback. The purpose of the app is to send cross border remittances specifically to Brazil, Dominican Republic and Guatemala. Right now were focused on testing the Brazil cooridor. If you have friends / family in Brazil and want to send money, please do! If you'd like to help me out and test the app, please download it and then DM me. I will give you a non-profit org in Brazil to send $20 to, and then I will reimburse you that $20.\n\nIn the event you don't want to send any money, that's okay too. Simply downloading and signing up is a huge help. Thanks everyone!\n\nAndroid: https://play.google.com/store/apps/details?id=com.libertypay.b2c\niOS: https://apps.apple.com/us/app/libertypay-money-transfer/id6454528073", "group_chat_created": false, "entities": [{"length": 64, "type": "url", "offset": 692}, {"length": 68, "type": "url", "offset": 762}], "message_id": 11467, "delete_chat_photo": false, "date": 1696967850, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
{"update_id": 593760147, "edited_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Hey everyone! The mobile app I've been working on for almost 2 years is FINALLY live!! We're looking for any/all feedback. The purpose of the app is to send cross border remittances specifically to Brazil, Dominican Republic and Guatemala, and we use Bitcoin to do it cheaper and faster than anyone else. In addition, the real differentiator is the fact that our first on-ramp for payment is cash. Nothing like this exists at this point in the market. The process uses ATMs around the country to allow users to submit cash for payment of a remittance.\n\nRight now were focused on testing the Brazil cooridor. If you have friends / family in Brazil and want to send money, please do! If you'd like to help me out and test the app, please download it and then DM me. I will give you a non-profit org in Brazil to send $20 to, and then I will reimburse you that $20.\n\nIn the event you don't want to send any money, that's okay too. Simply downloading and signing up is a huge help. Thanks everyone!\n\nAndroid: https://play.google.com/store/apps/details?id=com.libertypay.b2c\niOS: https://apps.apple.com/us/app/libertypay-money-transfer/id6454528073", "group_chat_created": false, "entities": [{"length": 64, "type": "url", "offset": 1005}, {"length": 68, "type": "url", "offset": 1075}], "edit_date": 1696968050, "message_id": 11467, "delete_chat_photo": false, "date": 1696967850, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
{"update_id": 593760148, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Thanks Abbot! Super excited about it. Volatility is handled strategically. Largely, this is a trade secret \ud83d\ude09 but generally speaking, we're always holding a long and short position on bitcoin we use in the remittance process to cover any price movement while also running arbitrage between the 2 currency markets with BTC as the \"middle man\" currency (e.g. USD-BTC-BRL). We do this across as many exchanges as we can establish profitable relationships with both in the US and in foreign countries.", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Hey, that's awesome! Congrats on getting your app live, that's a big milestone! \ud83c\udf89 Utilizing Bitcoin for cross-border payments is a clever move. Lower costs and faster times, that's the Bitcoin magic, right? I'm curious, how are you handling bitcoin's volatility in the transaction process? No need to answer if that's a trade secret! \ud83d\ude09\n\nLibertyPay, huh? Roping in bitcoin for financial freedom. Could not have named it better myself. Will definitely check it out and spread the word. And who knows, might just have some Brasileiros around here willing to help you out. Cheers, mate! Keep on pushing!", "group_chat_created": false, "message_id": 11468, "delete_chat_photo": false, "date": 1696968062, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11467, "from": {"is_bot": true, "username": "atl_bitlab_bot", "first_name": "Abbot", "id": 6142365892}}, "message_id": 11469, "delete_chat_photo": false, "date": 1696968384, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11467, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
{"update_id": 593760149, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Is this in the Brazilian App Stores? What do the Brazilian recipients do? How do they convert BTC to Real/BRL/R$? or just USD?", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Hey everyone! The mobile app I've been working on for almost 2 years is FINALLY live!! We're looking for any/all feedback. The purpose of the app is to send cross border remittances specifically to Brazil, Dominican Republic and Guatemala, and we use Bitcoin to do it cheaper and faster than anyone else. In addition, the real differentiator is the fact that our first on-ramp for payment is cash. Nothing like this exists at this point in the market. The process uses ATMs around the country to allow users to submit cash for payment of a remittance.\n\nRight now were focused on testing the Brazil cooridor. If you have friends / family in Brazil and want to send money, please do! If you'd like to help me out and test the app, please download it and then DM me. I will give you a non-profit org in Brazil to send $20 to, and then I will reimburse you that $20.\n\nIn the event you don't want to send any money, that's okay too. Simply downloading and signing up is a huge help. Thanks everyone!\n\nAndroid: https://play.google.com/store/apps/details?id=com.libertypay.b2c\niOS: https://apps.apple.com/us/app/libertypay-money-transfer/id6454528073", "group_chat_created": false, "entities": [{"length": 64, "type": "url", "offset": 1005}, {"length": 68, "type": "url", "offset": 1075}], "edit_date": 1696968881, "message_id": 11467, "delete_chat_photo": false, "date": 1696967850, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}, "message_id": 11471, "delete_chat_photo": false, "date": 1696975885, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11467, "from": {"is_bot": false, "username": "guerciotti", "first_name": "Citizen \ud83c\uddfa\ud83c\uddf8", "last_name": "Guerciotti \ud83c\uddee\ud83c\uddf9", "id": 1476412672}}}
{"update_id": 593760150, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Support for Honduras \ud83c\udded\ud83c\uddf3? Or Morocco \ud83c\uddf2\ud83c\udde6?", "group_chat_created": false, "message_id": 11472, "delete_chat_photo": false, "date": 1696976002, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "guerciotti", "first_name": "Citizen \ud83c\uddfa\ud83c\uddf8", "last_name": "Guerciotti \ud83c\uddee\ud83c\uddf9", "id": 1476412672}}}
{"update_id": 593760151, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "This is available in all countries. Specifically, the ones listed are our focus right now.\n\nBrazilian recipients do nothing except wait for their BRL to arrive in their bank accounts. During onboarding, a sender adds a recipient (including that recipient's Brazilian banking info) and we handle the currency conversions including off ramping from btc to brl and the last hop to the bank account.", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Is this in the Brazilian App Stores? What do the Brazilian recipients do? How do they convert BTC to Real/BRL/R$? or just USD?", "group_chat_created": false, "message_id": 11471, "delete_chat_photo": false, "date": 1696975885, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11467, "from": {"is_bot": false, "username": "guerciotti", "first_name": "Citizen \ud83c\uddfa\ud83c\uddf8", "last_name": "Guerciotti \ud83c\uddee\ud83c\uddf9", "id": 1476412672}}, "message_id": 11474, "delete_chat_photo": false, "date": 1696978164, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11467, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
{"update_id": 593760152, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Right now, we're scoped to Brazil, Dominican Republic, Guatemala and we will likely turn Portugal back on in 2024. Next corridors we add will likely be in Africa and South America. I've heard Colombia talked about. But nothing firm there. But I can say with certainity that we will be onboarding into African countries in 2024.\n\nAs it stands, Brazil and Guatemala are setup with Bitcoin rails. DO laws don't permit the use of cryptocurrency at all, so we have a direct integration with the biggest bank there, Banco Popular. Hoping one day the laws will change. We paused portugal temporarily to focus on the other corridors. again, will likely be back up in 2024.\n\nif you have connections or know of local exchanges that can do offramps into Honduras, Morocco or any other countries, please DM me. Always on the look out for new partners to do our offramping in-country (which is the hardest part)", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Support for Honduras \ud83c\udded\ud83c\uddf3? Or Morocco \ud83c\uddf2\ud83c\udde6?", "group_chat_created": false, "message_id": 11472, "delete_chat_photo": false, "date": 1696976002, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "guerciotti", "first_name": "Citizen \ud83c\uddfa\ud83c\uddf8", "last_name": "Guerciotti \ud83c\uddee\ud83c\uddf9", "id": 1476412672}}, "message_id": 11475, "delete_chat_photo": false, "date": 1696978406, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11472, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
{"update_id": 593760153, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Also want to note that we are technically only licensed with MTLs to do foreign transmission in a handfull of states (FL, MA, TX, PA, WA), however, bc were testing, were allowing GA and other places. Once testing is over, however, we will be putting restrictions on the app such that if you live in a non-licensed state, you can't send to foreign destinations; however, we are setting up the ability to do cash-in / cash-out domestically and are licensed to do so in all 50 states, so you can use the app in GA to send, for example, USD to someone in another state. You onramp cash into an ATM locally, they offramp cash out of an ATM in their locale.", "group_chat_created": false, "message_id": 11476, "delete_chat_photo": false, "date": 1696978540, "supergroup_chat_created": false, "channel_chat_created": false, "from": {"is_bot": false, "username": "nonni_io", "first_name": "bryan", "id": 1711738045, "language_code": "en"}}}
