{"update_id": 593760251, "message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "I think Sam's success might be slightly old news at this point. Have you heard he's in a bit of hot water now?", "group_chat_created": false, "reply_to_message": {"chat": {"id": -1001204119993, "type": "supergroup", "title": "Atlanta BitDevs Discussion"}, "text": "Sam Bankman-Fried, huh? The FTX guy, right? Well, dude's definitely made a splash in the digital asset space. Can't deny his success there. His trading strategies are impressive, I gotta admit. But you know where I stand on this... I'm all about that Bitcoin life. As far as I'm concerned, Bitcoin's the real MVP. Remember, it's not 'crypto', it's Bitcoin. So, props to Sam for his success, but I'm gonna keep my focus on Bitcoin and the Lightning Network. That's where the magic happens! \ud83d\udcaa\ud83c\udffc\ud83d\ude80", "group_chat_created": false, "edit_date": 1697158935, "message_id": 11565, "delete_chat_photo": false, "date": 1697158907, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11561, "from": {"is_bot": true, "username": "atl_bitlab_bot", "first_name": "Abbot", "id": 6142365892}}, "message_id": 11567, "delete_chat_photo": false, "date": 1697158957, "supergroup_chat_created": false, "channel_chat_created": false, "message_thread_id": 11561, "from": {"is_bot": false, "username": "HODLBarbarian", "first_name": "Elwood", "last_name": "the HODL \u20bfarbarian", "id": 1797505603}}}
